/* eslint-disable import/prefer-default-export */
export const GetAccount = async idcliente => {
	const requestOptions = {
		method: 'POST',
		headers: {
			'Content-Type': 'application/json'
		},
		body: JSON.stringify({ idcliente: idcliente })
	};

	const resp = await fetch(`https://fl8vvup0y0.execute-api.us-east-1.amazonaws.com/dev`, requestOptions);
	const sku = await resp.json();

	// console.log('perro', sku);
	return sku;
};
